import styled from 'styled-components';

const Container = styled.div`
  /* width: 100px;
  height: 100px; */
  background: white;
  border: 10px;
  padding: 20px;
  display: flex;
  align-items: center;
  justify-content: center;
  outline: 3px solid black;
`;

export default function EmbeddedBox() {
  return (
    <Container>
      <div>
        <h2>請貼上 EmbeddedCode </h2>
        <textarea placeholder='貼上 embedded-code 字串'></textarea>
      </div>
    </Container>
  );
}
